import React from 'react';
import { 
  Timeline, 
  TimelineItem, 
  TimelineSeparator, 
  TimelineDot, 
  TimelineConnector, 
  TimelineContent 
} from '@mui/lab';
import { timelineContentClasses } from '@mui/lab/TimelineContent';
import TimelineOppositeContent from '@mui/lab/TimelineOppositeContent';
import Chip from '@mui/material/Chip';
import Stack from '@mui/material/Stack';

const Experience = () => {
  return (
    <div id="experience-section">
      <Timeline>
        <TimelineItem>
          <TimelineOppositeContent color="textSecondary">
            June 2023 - August 2023
          </TimelineOppositeContent>
          <TimelineSeparator>
            <TimelineDot />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
            <h4>Math and English Tutor @ Kumon</h4>
            <p>• Tutored students of all ages in Math and English through personalized teaching methods to increase comprehension of skills</p>
            <p>• Maintained accurate records and performed timely data entry of student grades into the gradebook system</p>
            <Stack direction="row" spacing={1} sx={{ mt: 2 }}>
              <Chip label="Data Entry" />
              <Chip label="Mentorship" />
              <Chip label="Communication" />
